import React from "react";

const Users = props => {
  return (
    <div>
      {props.users.map(u => (
        <li key={u.id}>
          <div>
            <span>
              <div>
                <img src="" alt="" />
              </div>
              <div>
                <button>follow</button>
              </div>
            </span>
            <span>
              <span><div></div><div></div></span>
              <span><div></div><div></div></span>
            </span>
          </div>
        </li>
      ))}
    </div>
  );
};

export default Users;
